class Node:
    def __init__(self, key):
        self.key = key
        self.left = None
        self.right = None
        self.p = None

class BinarySearchTree:
    def __init__(self):
        self.root = None

    def insert(self, key):
        z = Node(key)
        y = None
        x = self.root
        while x is not None:
            y = x
            if z.key < x.key:
                x = x.left
            else:
                x = x.right
        z.p = y
        if y is None:
            self.root = z
        elif z.key < y.key:
            y.left = z
        else:
            y.right = z

    def inorder(self, x):
        if x is not None:
            self.inorder(x.left)
            print(x.key, end=' ')
            self.inorder(x.right)

    def preorder(self, x):
        if x is not None:
            print(x.key, end=' ')
            self.preorder(x.left)
            self.preorder(x.right)

    def print_tree(self):
        print('Inorder: ', end='')
        self.inorder(self.root)
        print()
        print('Preorder: ', end='')
        self.preorder(self.root)
        print()

def main():
    bst = BinarySearchTree()
    m = int(input())
    for _ in range(m):
        op = input().split()
        if op[0] == 'insert':
            bst.insert(int(op[1]))
        elif op[0] == 'print':
            bst.print_tree()

